★エレアのインナーパンツ！<br>
<br>
●縦方向と横方向両方に伸びるストレッチ性により運動しやすく、柔らかく気持ちの良い肌触り！<br>
●ウエストにはゴムと調節紐付き！<br>
●シンプルなデザインで、サッカー、フットサル以外にもジムなどのトレーニングシーンでご利用できます。<br>
●安心の日本製！<br>
<br>
■素材 ポリエステル90％、ポリウレタン10％<br>
■企画製造販売元 豊島株式会社<br>
