★ナイキのハーフパンツ！<br>
<br>
●軽量で、汗を吸い上げ逃がすことでさらっと快適に保つDRI-FIT素材を採用したショートパンツ。<br>
●ウエストはゴム仕様で身体にフィットします。コード付きでフィット感の調節も可能。<br>
●裾の両サイドにスリット入り。<br>
●右裾にスウッシュロゴ刺繍を施したシンプルなデザイン。<br>
●あらゆるスポーツやトレーニングはもちろん、快適な着心地はリラックスウェアとしてもおすすめのアイテムです。<br>
<br>
■素材 ポリエステル100％<br>
